import React from 'react';
import Profile from './components/Profile/Profile';
import userData from './data/user';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <Profile
        username={userData.name}
        tag={userData.tag}
        location={userData.location}
        avatar={userData.avatar}
        stats={userData.stats}
      />
    </div>
  );
};

export default App;
